type application_signature = {
  function_name : string option;
  function_position : Msource.position;
  signature : string;
  parameters : parameter_info list;
  active_param : int option;
}

value:
(match let buffer = Buffer.create 16 in
      let ppf = Format.formatter_of_buffer buffer in
      let rec separate ?(parameters= []) args ty =
        match (args, (Types.get_desc ty)) with
        | ((_l, arg)::args, Tarrow (label, ty1, ty2, _)) ->
            let parameter =
              print_parameter_offset ?arg ppf buffer e.exp_env label ty1 in
            separate ?parameters:(Some (parameter :: parameters)) args ty2
        | ([], Tarrow (label, ty1, ty2, _)) ->
            let parameter =
              print_parameter_offset ?arg:None ppf buffer e.exp_env label ty1 in
            separate ?parameters:(Some (parameter :: parameters)) args ty2
        | _ ->
            (Format.fprintf ppf
               (CamlinternalFormatBasics.Format
                  ((CamlinternalFormatBasics.Alpha
                      (CamlinternalFormatBasics.Flush
                         CamlinternalFormatBasics.End_of_format)), "%a%!"))
               (pp_type e.exp_env) ty;
             {
               active_param = None;
               parameters = (List.rev parameters);
               signature = (Buffer.contents buffer);
               function_position = (`Offset (((e.exp_loc).loc_end).pos_cnum));
               function_name = (extract_ident e.exp_desc)
             }) in
      separate ?parameters:None args e.exp_type
with
| { function_name; function_position; signature; parameters; active_param }
    -> _)

