value:
(match match (ppx_kind_with_attr : (ppx_kind * Warnings.loc)) with
      | (Expr _, ext_loc) ->
          {
            attr_end = (ext_loc.loc_end);
            attr_start = (ext_loc.loc_start);
            code =
              (Pprintast.string_of_expression (Option.get (!expression)))
          }
      | (Sig_item _, attr_loc) ->
          let exp =
            Pprintast.signature Format.str_formatter (List.rev (!signature));
            Format.flush_str_formatter () in
          {
            attr_end = (attr_loc.loc_end);
            attr_start = (attr_loc.loc_start);
            code = exp
          }
      | (Str_item _, attr_loc) ->
          let exp =
            Pprintast.structure Format.str_formatter (List.rev (!structure));
            Format.flush_str_formatter () in
          {
            attr_end = (attr_loc.loc_end);
            attr_start = (attr_loc.loc_start);
            code = exp
          }
with
| { code; attr_start; attr_end } -> _)

